import Layout from "../components/Layout";

function Home() {
  return (
    <div className="Home">
      <Layout>
        <h1 className="text-6xl text-center text-6xl hover:transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300">Hello world!</h1>
        <br/><hr/><br/>
        <h1 className="bg-emerald-100 rounded-lg w-28 text-2xl animate-pulse ring-2 ring-purple-500">Meowww!</h1><br/><br/><br/>
        <h1 className="text-center bg-emerald-100 rounded-full w-10 text-4xl animate-spin ring-2 ring-purple-500">:)</h1><br/><br/><br/>
        <div class="flex justify-center">
        </div>
        <h1 className="flex justify-center bg-emerald-100 rounded-full w-20 h-20 pt-4 text-4xl animate-bounce ring-2 ring-purple-500"> ^_^ </h1>
        <div class="flex justify-center">
          <button class="bg-violet-400 opacity-50 ring-2 mt-10 ring-purple-500 h-10 w-20 rounded-lg hover:shadow-2xl hover:shadow-emerald-900 transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300">Just click</button>
        </div>
      </Layout>
    </div>
    );
}

export default Home;
